_.rV=_.sV=function(){return(0,_.w)("Cuenta de Google")};_.y("e",0,function(){return(0,_.w)('<p>A todos los dispositivos conectados a Internet se les asigna un n\u00famero denominado direcci\u00f3n IP (de "Internet Protocol", protocolo de Internet). Estos n\u00fameros suelen asignarse en bloques geogr\u00e1ficos. Una direcci\u00f3n IP se puede utilizar normalmente para identificar la ubicaci\u00f3n desde la que un dispositivo est\u00e1 conectado a Internet.</p>')});
_.y("f",0,function(){return(0,_.w)('<p>Como la mayor\u00eda de los sitios web, nuestros servidores registran de forma autom\u00e1tica las solicitudes de p\u00e1ginas que se realizan cuando se visitan nuestros sitios. Estos \u00abregistros de servidor\u00bb incluyen la solicitud web, la direcci\u00f3n IP, el tipo de navegador, el idioma del navegador, la fecha y la hora de la solicitud, y una o varias cookies que identifican de forma exclusiva al navegador del usuario.</p><p>Ejemplo de una entrada de registro t\u00edpica de la b\u00fasqueda de la palabra "cars":</p><pre>123.45.67.89 - 25/Mar/2003 10:15:32 -<br>http&#58;//www.google.com/search?q=cars -<br>Firefox 1.0.7; Windows NT 5.1 -<br>740674ce2123e969</pre><ul><li><code>123.45.67.89</code> Es la direcci\u00f3n de protocolo de Internet asignada al usuario por su proveedor de servicios de Internet; seg\u00fan el servicio de dicho usuario, es posible que su proveedor le asigne direcciones diferentes cada vez que se conecte a Internet.</li><li><code>25/Mar/2003 10:15:32</code> Fecha y hora de la consulta.</li><li><code>http&#58;//www.google.com/search?q=cars</code> URL solicitada; incluida la consulta de b\u00fasqueda.</li><li><code>Firefox 1.0.7; Windows NT 5.1</code> Navegador y sistema operativo utilizados.</li><li><code>740674ce2123a969</code> Es la ID de cookie exclusiva asignada a este equipo en particular la primera vez que visit\u00f3 Google. Los usuarios pueden eliminar las cookies, por lo que, en el caso de que un usuario haya eliminado las cookies de su dispositivo desde la \u00faltima vez que visit\u00f3 Google, se le asignar\u00e1 una nueva ID de cookie exclusiva la pr\u00f3xima vez que visite Google desde ese dispositivo en particular.</li></ul>')});
